import React from 'react';
import {Navbar} from 'react-bootstrap';
import { Link } from "react-router-dom";
import Route from "./Route";


function Home(props)
{
  return(
    <div className="App container">
      <Navbar fluid collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">Scratch</Link>
          </Navbar.Brand>
          <Navbar.Toggle/>
        </Navbar.Header>  
      </Navbar>
      <Route />

    </div>
  );
}
export default Home;
